import Head from 'next/head';
import Navbar from './navbar.js';
import Footer from './footer.js';
import Link from 'next/link';

import SignUp from '../components/sign-up.js';
import Layout5 from '../components/layout5.js';

const Layout = (props) => (
	<div>
	<Head>
		<title>Audio-Boy</title>
		<link rel='icon' type='image/png' href='https://i.imgur.com/Xc2Et4w.png' />

	</Head>
		<div className='topBanner'>Subscribe <span className='bold'>NOW</span> for our updates & promotions! <span className='bold'><span className='linkHere' onClick={signUpFrom}>OVER HERE</span></span> 
		</div>
		<Navbar />
		<div className='containerWrapper'>
			<div className='container'>
				{props.children}
			</div>
		</div>
		<Footer />
	</div>
);

function signUpFrom(){
	return(
		<div>
			<Signup />
		</div>
	)
}

export default Layout;
